This PR aims to fix performance issues on the SPNEGO support and the use of the  `@Synchronized` annotation on the `JcifsSpnegoAuthenticationHandler`. Instead, a `BlockingQueue` is used.

To demonstrate the problem, I have setup a CAS server v7.0.0-RC2 with the `cas-server-support-spnego-webflow` dependency. I have created a new `jcifs.spnego.Authentication` object with:

```java
package jcifs.spnego;

import java.security.Principal;
import java.util.Properties;

public class Authentication {
    public Authentication() {
    }

    public Authentication(Properties properties) {
    }

    public byte[] getNextToken() {
        return null;
    }

    public Principal getPrincipal() {
        int wait = (int)(100 * (1 + Math.random()));

        try {
            Thread.sleep(wait);
        } catch (final InterruptedException e) {
            throw new RuntimeException(e);
        }

        return new Principal() {
            @Override
            public String getName() {
                return "jleleu" + System.currentTimeMillis();
            }
        };
    }

    public Properties getProperties() {
        return null;
    }

    public void setProperties(Properties properties) {
    }

    public String getProperty(String property) {
        return null;
    }

    public void setProperty(String property, String value) {
    }

    public void init(String[] mechanisms) throws AuthenticationException {
    }

    public void reset() {
    }

    public void process(byte[] token) throws AuthenticationException {
    }
}

```

And "mocked" the `SpnegoCredentialsAction`:

```java
...
    @Override
    protected Credential constructCredentialsFromRequest(final RequestContext context) {
        return new SpnegoCredential("fake".getBytes(StandardCharsets.UTF_8));
    }
...
```

As well as the configuration:

```yaml
cas.authn.spnego.properties:
  - jcifs-domain: fake
cas.authn.spnego.supported-browsers: MSIE,Trident,Firefox,AppleWebKit,ApacheBench
```

Then, I have made two performance benchmarks: `ab -k -c 10 -n 200 http://localhost:8080/cas/login`.

Scenario 1: implementation of `getPrincipal` waits between 100 and 200 ms (see above).
Scenario 2: implementation of `getPrincipal` waits 100ms or 5000ms (one of 10 times):

```java
    public Principal getPrincipal() {
        int wait = 100;
        int random = (int) (10 * Math.random());
        if (random == 9) {
            wait = 5000;
        }

        try {
            Thread.sleep(wait);
        } catch (final InterruptedException e) {
            throw new RuntimeException(e);
        }

        return new Principal() {
            @Override
            public String getName() {
                return "jleleu" + System.currentTimeMillis();
            }
        };
    }
```

Current SPNEGO support:
Scenario 1: Requests per second:    6.56 [#/sec] (mean)
Scenario 2: Requests per second:    1.49 [#/sec] (mean)

Using this PR:
Scenario 1: Requests per second:    54.38 [#/sec] (mean)
Scenario 2: Requests per second:    11.78 [#/sec] (mean)

Performance are much better with the `BlockingQueue`.

